import React from 'react'
import './Resume.css';


function Resume() {
    return (
        <div id="resume">
            <h1 id="resume-title">resume</h1>
            <h3 className="resume-headings">Education</h3>
            <hr className="resume-hr" />
            <h4 className="resume-subheading">The University of Tennessee, Knoxville,</h4>
            <h4 className="resume-subtitles"></h4>
        </div>
    )
}


export default Resume
